import Vue from 'vue'
import VueRouter from 'vue-router'
import MainPage from '../views/MainPage.vue'
import Dislocation from '../views/Dislocation.vue'
import Transp from '../views/Transp.vue'
import team from '../views/Team.vue'
import create_order from '../views/order_create.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'MainPage',
    component: MainPage
  },
  {
    path: '/dislocation',
    name: 'Dislocation',
    component: Dislocation
  },
  {
    path: '/transp',
    name: 'Transp',
    component:Transp
  },
  {
    path: '/team',
    name: 'team',
    component:team
  },
  {
    path: '/create_order',
    name: 'create_order',
    component: create_order
     }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
